import React from 'react';
import { UncontrolledCarousel } from 'reactstrap';

const items = [
  {
    src: 'https://cdn.images.dailystar.co.uk/dynamic/58/photos/451000/620x/Maurizio-Sarri-731688.jpg',
    altText: 'Slide 1',
    caption: 'Slide 1',
    header: 'Slide 1 Header'
  },
  {
    src: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT9WBF6tPyWEsffKZSPkTDTGB6ODvJAzMERC336NnvV7zmd3NXD',
    altText: 'Slide 2',
    caption: 'Slide 2',
    header: 'Slide 2 Header'
  },
  {
    src:'https://www.foxsportsasia.com/uploads/2019/07/4-3-1.jpg',
    altText: 'Slide 3',
    caption: 'Slide 3',
    header: 'Slide 3 Header'
  }
];

const AppBody = () => <UncontrolledCarousel items={items} />;



export default AppBody;
